script: |
  super -f text -I q757.spq | sort > q757.out

inputs:
  - name: q757.spq
    data: |
      SELECT CAST ( NULL AS INTEGER ) + col2 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN + + 94 - - col0 + + CAST ( NULL AS INTEGER ) * - col1 * ( col2 - - col2 ) AND - col0;
  - name: tab2

outputs:
  - name: q757.out
    data: |
